# yaml-language-server: $schema=../.schema.yaml
title: Suppression of a SARS-CoV-2 outbreak in the Italian municipality of Vo
doi: 10.1038/s41586-020-2488-1
description: >
  This study was conducted in the Italian municipality of Vo. Lockdown was implemented
  after first death of pneumonia was reported. Two surveys and virus tests were conducted
  with the first survey near the start of lockdown and the second one at the end of
  lockdown
analytes:
  RdRp_first_pos:
    description: >
      SARS-CoV-2 RNA genome copy concentration calculated from evaluation of RdRp
      gene, and the reference event is first positive day.
    specimen: oropharyngeal_swab
    biomarker: SARS-CoV-2
    gene_target: RdRp
    limit_of_quantification: unknown
    limit_of_detection: unknown
    unit: gc/mL
    reference_event: confirmation date
  E_first_pos:
    description: >
      SARS-CoV-2 RNA genome copy concentration calculated from evaluation of E gene,
      and the reference event is first positive day.
    specimen: oropharyngeal_swab
    biomarker: SARS-CoV-2
    gene_target: E
    limit_of_quantification: unknown
    limit_of_detection: unknown
    unit: gc/mL
    reference_event: confirmation date
  RdRp_symptom:
    description: >
      SARS-CoV-2 RNA genome copy concentration calculated from evaluation of RdRp
      gene, and the reference event is symptom onset day.
    specimen: oropharyngeal_swab
    biomarker: SARS-CoV-2
    gene_target: RdRp
    limit_of_quantification: unknown
    limit_of_detection: unknown
    unit: gc/mL
    reference_event: symptom onset
  E_symptom:
    description: >
      SARS-CoV-2 RNA genome copy concentration calculated from evaluation of E gene,
      and the reference event is symptom onset day.
    specimen: oropharyngeal_swab
    biomarker: SARS-CoV-2
    gene_target: E
    limit_of_quantification: unknown
    limit_of_detection: unknown
    unit: gc/mL
    reference_event: symptom onset
